sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.status_code == '200') {
    outputs.status = "Success";
    var response = JSON.parse(inputs.response);
    outputs.folder_id = response['id'];
    outputs.folder_info = inputs.response;
    outputs.moved_item_1 = response;
  } else {
    outputs = new BoxErrorHandler().moveOwnedItem(inputs, outputs);
  }
})(inputs, outputs);

